        public int FindMaxConsecutiveOnes(int[] nums)
        {
            int maxOnes = 0;
            int countLeft = 0;
            int countRight = 0;
            int currentCount = 0;
            bool leftOfPair = true;
            for (int i = 0; i <= nums.Length; i++)
            {
                if (leftOfPair && i == nums.Length)
                {
                    return currentCount;
                }
                if (i != nums.Length && nums[i] == 1) 
                {
                    currentCount++;
                }
                else
                {
                    if (leftOfPair)
                    {
                        countLeft = currentCount;
                        leftOfPair = false;
                    }
                    else
                    {
                        countRight = currentCount;
                        if (countLeft + countRight >= maxOnes)
                        {
                            maxOnes = countLeft + countRight;
                        }

                        countLeft = countRight;
                        countRight = 0;
                    }

                    currentCount = 0;
                }
                
            }

            if (leftOfPair == false)
            {
                maxOnes = maxOnes++;
            }
            return maxOnes;
        }
    }
